import React from "react";
import { Link } from "react-router-dom";
import { ShoppingCart } from "phosphor-react";

export const Navbar = () => {
    return (
        <div className="navbar">Navbar
            <div className="links">
                <Link to="/"> Shop </Link>
                <Link to="/cart"></Link>
            </div>
        </div>
  );
}
